import React from 'react'
import { connect } from 'react-redux'
import { bindActionCreators } from "redux"
import { changeValue } from "../store/test/actions"

const Index = ({test}) => {
  console.log(test)
  return (
    <div>

    </div>
  )
}

Index.getInitialProps = async ({ reduxStore, req }) => {
  const isServer = !!req
  if (isServer) {
    console.log(reduxStore)
    await reduxStore.dispatch(changeValue('Hello world'))
  }
  else reduxStore.dispatch(changeValue('Hello world'))
  return {}
}

const mapStateToProps = state => {
  return {
    test: state.test
  }
}

const mapDispatchToProps = dispatch => ({
  changeValue: bindActionCreators(changeValue, dispatch)
})

export default connect(mapStateToProps, mapDispatchToProps)(Index)
